import ReactDOM from 'react-dom';

const Modal= (props) => {
    return (
        ReactDOM.createPortal(
            <div className="ui dimmer modals visible active">
                <div className="ui modal visible active">
                   
                </div>
            </div>,
            document.querySelector('#modal')
        )
    );
}

export default Modal;
